def low_high_to_int(low, high):
    """
    将两个字节的高低位转化为整数
    :param low:
    :param high:
    :return:
    """
    value = high | (low << 8)
    return value


def high_low_to_int(low, high):
    """
    将两个字节的高低位转化为整数
    :param high:
    :param low:
    :return:
    """
    value = low | (high << 8)
    return value


